// src/components/Wiki.tsx
import React from 'react';
import { Box, Paper, Typography } from '@mui/material';

const Wiki: React.FC = () => {
  return (
    <Paper sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>Electrical Wiki</Typography>
      <Typography>
        This is the Electrical Wiki page. Here, you can search and view equipment manuals, troubleshooting guides, and best practices for the electrical industry.
      </Typography>
    </Paper>
  );
};

export default Wiki;
